      <text id="57" justification="0" size="4" underlined="false">
        <text>Note For sending numbers:

You can only send individual bytes through trough uart so we will have to mask the Numbers
This wont matter when sending the command numbers but when sending the step amount for the motors it will.
The numbers will need to be 32 bits long.
Here is example code for how to send and read the value.

Read:
int totalVal = 0;
totalVal |= (Serial.Read() &lt;&lt; 24);
totalVal |= (Serial.Read() &lt;&lt; 16);
totalVal |= (Serial.Read() &lt;&lt; 8);
totalVal |= Serial.Read();

Write:
int totalVal = 890238(some 32 bit integer that you want to send);
Serial.Write((totalVal &gt;&gt; 24) &amp; 0xff);
Serial.Write((totalVal &gt;&gt; 16) &amp; 0xff);
Serial.Write((totalVal &gt;&gt; 8) &amp; 0xff);
Serial.Write((totalVal &amp; 0xff));</text>
